fn main() {
    //bitcoin-cli getrawtransaction cd4a6bb55046e96c25d453f6e0a889c4cb75a6be86c86e67a689d8be7edb9318
    let tx_hex = "";
    let reftx_hex = "";
    let tx_bytes = hex::decode(tx_hex).unwrap();
    let reftx_bytes = hex::decode(reftx_hex).unwrap();
    let tx: bitcoin::Transaction =
        bitcoin::consensus::Decodable::consensus_decode(&mut tx_bytes.as_slice()).unwrap();
    let reftx: bitcoin::Transaction =
        bitcoin::consensus::Decodable::consensus_decode(&mut reftx_bytes.as_slice()).unwrap();

    let prevout = &reftx.output[42];

    let mut spent_outputs_vec = Vec::new();
    let script_pubkey = prevout.script_pubkey.clone().into_bytes();
    let utxo = bitcoinconsensus::Utxo {
        script_pubkey: script_pubkey.as_ptr(),
        script_pubkey_len: u32::try_from(script_pubkey.len()).unwrap(),
        value: i64::try_from(prevout.value.to_sat()).unwrap(),
    };
    spent_outputs_vec.push(utxo);

    let res = bitcoinconsensus::verify_with_flags(
        &prevout.script_pubkey.clone().into_bytes(),
        prevout.value.to_sat(),
        bitcoin::consensus::encode::serialize(&tx).as_slice(),
        Some(&spent_outputs_vec),
        0usize,
        bitcoinconsensus::height_to_flags(820000),
    )
    .unwrap();
    println!("res {:?}", res);
}
